import React,{useEffect,useState} from 'react'
function Testuser(){
    const[data,setData]=useState([])
        useEffect(()=>{
        fetch("https://jsonplaceholder.typicode.com/users").then((result)=>{
            result.json().then((resp)=>{
                console.warn("result",resp)
                setData(resp)
            })
        })

        },[])
        console.warn(data)
        return(
            <div className='get'>
                <h1>GET</h1>
                <table>
                    <tr>
                        <td>ID</td>
                        <td>NAME</td>
                        <td>EMAIL</td>
                        <td>MOBILE</td>
                    </tr>{
                        data.map((item)=>
                        <tr>
                            <td>{item.id}</td>
                            <td>NAME</td>
                            <td>EMAIL</td>
                            <td>MOBILE</td>
                        </tr>
                        )
                    }
                </table>
            </div>
        )
}
export default Testuser
